import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";

import "./CSS/auth.css";
import { BrowserRouter as Router, Link } from "react-router-dom";
import Axios from "axios";

function Register() {
  document.title = "DarkBank | User | LOGIN TO DASHBOARD";

  function registerBtn(e) {
    e.preventDefault();

    document.getElementById("registerID").innerHTML = "Please wait!";

    const urlLink = "localhost:5000/auth/register/";

    const dataObject = {
      email: "test",

      password: " Password"
    };

    Axios({
      method: "POST",

      url: urlLink,

      data: dataObject
    })
      .then(response => {
        console.log("seen");
      })
      .catch(err => {
        console.log("error",err);
      });
  }
  return (
    <div className="Authwrapper">
      <div className="Authwrapper fadeInAuthDown">
        <div id="AuthformContent">
          <div className="fadeInAuth first">CREATE ACCOUNT</div>

          <form id="registerForm">
            <input
              type="text"
              className="loginInput fadeInAuth second"
              name="email"
              placeholder="Firstname"
            />
            <input
              type="text"
              className="loginInput fadeInAuth second"
              name="email"
              placeholder="Lastname"
            />
            <input
              type="text"
              className="loginInput fadeInAuth second"
              name="email"
              placeholder="Email"
            />
            <input
              type="password"
              className="loginInput fadeInAuth third"
              name="password"
              placeholder="Password"
            />
            <input
              type="password"
              className="loginInput fadeInAuth third"
              name="password"
              placeholder="Confirm password"
            />
            <button
              variant="contained"
              color="primary"
              className="btn-auth fadeInAuth fourth"
              id="registerID"
              onClick={registerBtn}
            >
              REGISTER
            </button>
            <div className="orBox">
              <Link to="/auth/signin/" className="signInLink">
                {" "}
                Already own an account?
              </Link>
              {/* <hr className="hrAuth" />
              OR
              <hr className="hrAuth" />
              <button
                variant="contained"
                color="primary"
                className="btn-auth fadeInAuth fourth orBtn"
              >
                SIGNIN
              </button> */}
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
export default Register;
